import React from 'react';

class ProfileStatus extends React.Component {
    

    state = {
        editMode: false,
    }
    
    
    
    toogleEditMode() {
        alert(this.state.editMode);
    }


    
    render() {
        return (
            <div>
                <div>
                    <input onClick={this.toogleEditMode.bind(this)} type="text" value='Text' />
                </div>
                <div>
                    <span>Спанчик</span>
                </div>
            </div>
        )
    }
}

export default ProfileStatus
